else if(tSize < 60*60)			tmTp_value = tr("m"), size_value = tSize/60;
else if(tSize < 24*60*60)	tmTp_value = tr("h"), size_value = tSize/(60*60);
else									tmTp_value = tr("d"), size_value = tSize/(24*60*60);
