else if(!aMax.isEVal() && !aMin.isEVal() && aMax > aMin && (varEl >= aMax || varEl <= aMin)) lb_val_color = lb_sfr_color = lb_ed_color =  labColorAlarm;
else if(!wMax.isEVal() && !wMin.isEVal() && wMax > wMin && (varEl >= wMax || varEl <= wMin)) lb_val_color = lb_sfr_color = lb_ed_color =  labColorWarning;

lb_ed_text = ed.isEVal() ? "" : ed;

//Blink focused or linked with ElCadr
if(this.attr("focus") ||
		(!name.isEVal() && name.length && this.wdgAt("/s/pg_control/pg_ElCadr",true).attr("pgOpen") && this.wdgAt("/s/pg_control/pg_ElCadr",true).attr("prmShifr") == name))
{
  bordColor = (bordColor == "silver") ? "gray" : "silver";
  bordWidth =  2;
}
else { bordWidth =  1; bordColor = "black"; }

//Check the regulator mode
if(!enMode.isEVal() && enMode) { 
  mode_en = true; 
  if(!pModeC.isEVal() && pModeC) mode_text = tr("C");
  else mode_text = pModeA.isEVal() ? "" : ((pModeA) ? tr("A") : tr("M")); 
}
else mode_en = false;

//Events process
toSave = false;
for(evRez = "", off = 0; (evCur=event.parse(0,"\n",off)).length; ) {
	//this.messInfo("Event: "+evCur);
	if(evCur == "key_mouseDblClick" || evCur == "usr_hideshow") bordStyle = (bordStyle==1) ? 3 : 1;
	//Store session''s assignments
	else if(evCur == "usr_set")	toSave = true;
	else evRez += evCur+"\n";
}
event = evRez;

if(toSave || (f_start && allowSel && !loadOK)) {
	for(off = 0; (lnA="addr;name;dscr;min;max;log;ed;prec;aMax;aMin;wMax;wMin;pModeA;pModeC;color".parse(0,";",off)).length; )
		if(lnA == "color")	this.attrSet(user+lnA, color, true);
		else this.attrSet(user+lnA, this.link(lnA), true);
}

if(!color_.length)	color_ = color;
if(bordStyle == 1 && color != "-")			color_ = color, color = "-";
else if(bordStyle != 1 && color == "-")	color = color_;
trClr_lineClr = (color.length && color != "-") ? color : "gray";

tipTool = "";
if(!name.isEVal())	tipTool += tr("Name")+": "+name+"\n";
if(!min.isEVal() && !max.isEVal() && max > min) tipTool += tr("Scale")+": "+min+" ... "+max+"\n";
if(!aMin.isEVal() && !aMax.isEVal() && aMax > aMin) tipTool += tr("Alarm border")+": "+aMin+" ... "+aMax+"\n";
if(!wMin.isEVal() && !wMax.isEVal() && wMax > wMin) tipTool += tr("Warning border")+": "+wMin+" ... "+wMax+"\n";
if(!dscr.isEVal()) {
	tipTool += tr("Description")+": "+dscr+"\n";
	tipStatus = dscr;
}','','',500,'path;perm;name;dscr;en;active;geomW;geomH;tipTool;tipStatus;contextMenu;evProc;backColor;bordWidth;bordColor;bordStyle;',1629034662);
