		else props_geomH = geomH-props_geomY;
		//SYS.messInfo("ObjProps","WR: "+it.wr+"; it="+it);
	}
	else if(sval == "ws_LnAccept:/set" && (it=objItems[props_value])) it.set = set_value;
	else ev_rez += sval+"\n";
}
