if(f_start) {
	c1Sv = c1;
	contextMenu = "";
	if(!com.isEVal() || !close.isEVal())
		contextMenu =	(digComs.isEVal()?tr("Start"):digComs.parse(0,";").parse(0,"-"))+":open\n"+
