		if(pO.prec.isEVal())	pO.prec = 0;
		if(!pO.name.isEVal() && pO.name.length && !pO.var.isEVal() && (aO=SYS.nodeAt(pO.var).arch())) {
			params.push(pO);
			dtPeriod = max(dtPeriod, ceil(1e-6*aO.period()));
